fn iterator_benchmark(c: &mut Criterion) {
    c.bench_function("small polyline5 points count", |b| {
        b.iter(|| {
            black_box(PolylineIter::new(SMALL_POLYLINE, 5).count());
        })
    });
    c.bench_function("large polyline5 points count", |b| {
        b.iter(|| {
            black_box(PolylineIter::new(LARGE_POLYLINE, 5).count());
        })
    });

    c.bench_function("iter small polyline5", |b| {
        b.iter(|| {
            for (lat, lon) in PolylineIter::new(SMALL_POLYLINE, 5) {
                black_box((lat, lon));
            }
        })
    });
    c.bench_function("iter large polyline5", |b| {
        b.iter(|| {
            for (lat, lon) in PolylineIter::new(LARGE_POLYLINE, 5) {
                black_box((lat, lon));
            }
        })
    });
}

fn geo_polyline_benchmark(c: &mut Criterion) {
    c.bench_function("small polyline5 points count", |b| {
        b.iter(|| {
            black_box(
                polyline::decode_polyline(SMALL_POLYLINE, 5)
                    .unwrap()
                    .0
                    .len(),
            );
        })
    });
    c.bench_function("large polyline5 points count", |b| {
        b.iter(|| {
            black_box(
                polyline::decode_polyline(LARGE_POLYLINE, 5)
                    .unwrap()
                    .0
                    .len(),
            );
        })
    });

    c.bench_function("iter small polyline5", |b| {
        b.iter(|| {
            for point in polyline::decode_polyline(SMALL_POLYLINE, 5).unwrap() {
                black_box((point.y, point.x));
            }
        })
    });

    c.bench_function("iter large polyline5", |b| {
        b.iter(|| {
            for point in polyline::decode_polyline(LARGE_POLYLINE, 5).unwrap() {
                black_box((point.y, point.x));
            }
        })
    });
}

criterion_group!(benches, iterator_benchmark);
criterion_main!(benches);
